import React from "react";
import { Header } from "./homepage";
import { useNavigate } from "react-router";

function Main(props){
    let lgt=useNavigate();
function Logout(){ 

    localStorage.removeItem('auth');
    lgt('/');

 }
    return(
        <div>
             <Header  navi={Logout}   work="WORK" login="LOGOUT" sidebar="mainsidebar" contact="CONTACT" teamfont='fa fa-user' workfont='fa fa-th' contactfont='fa fa-envelope' loginfont='fa fa-usd' ></Header>
        </div>
    );
}

export default Main;
